n  // Pricing & Availability\n  depositAmount      Float // percentage\n  minimumHours       Float\n  cancellationPolicy String  @db.VarChar(50) // flexible, moderate, strict, non_refundable\n  packageDeals       String? @db.Text\n\n  // Images and Media\n  imageUrls String[]\n\n  // Payment and Vendor Information\n  transactionSignature String  @db.VarChar(255)\n  transactionLink      String? @db.VarChar(255)\n  vendorId             String  @db.Uuid\n\n  // Status and Stats\n  status        String   @default(\"PENDING\") @db.VarChar(50)\n  views         Int      @default(0)\n  sponsored     Boolean  @default(false)\n  sponsoredType String   @default(\"NotSponsored\") @db.VarChar(50)\n  endDate       DateTime @default(now()) @map(\"end_date\")\n\n  @@index([vendorId])\n  @@map(\"helicopter_charters\")\n}\n\nmodel HelicopterForCharterMessages {\n  id                String    @id @default(uuid()) @db.Uuid\n  customerName      String    @db.VarChar(100)\n  customerEmail     String    @db.VarChar(255)\n  customerCountry   String?   @db.VarChar(100)\n  departureLocation String    @db.VarChar(100)\n  arrivalLocation   String    @db.VarChar(100)\n  departureDate     DateTime\n  returnDate        DateTime?\n  passengerCount    Int\n  specialRequests   String?   @db.Text\n  listingId         String    @db.Uuid\n  vendorId          String    @db.Uuid\n  createdAt         DateTime  @default(now())\n  read              Boolean   @default(false)\n}\n\nmodel Car {\n  id              String          @id @default(uuid())\n  brand           String\n  model           String\n  year            Int\n  carType         CarType\n  color           String\n  interiorColor   String\n  seats           Int\n  doors           Int?\n  transmission    Transmission\n  driveType       DriveType\n  fuel            FuelType\n  condition       ConditionLevel?\n  price           Float\n  weeklyDiscount  Float?\n  monthlyDiscount Float?\n  deposit         Float?\n  vin             String?\n  licensePlate    String?\n  deliveryOption  DeliveryOption?\n  insuranceInfo   String?\n  rentalTerms     String?\n  description     String\n  features        String[]\n  isFeatured      Boolean         @default(false)\n  isAvailable     Boolean         @default(true)\n  mileage         Int?\n  engineSize      String?\n  horsepower      Int?\n  acceleration    Float?\n  topSpeed        Int?\n  images          String[]\n  location        String\n  vendorId        String\n  status          String          @default(\"PENDING\")\n  sponsored       Boolean         @default(false)\n  endDate         DateTime        @default(now())\n  createdAt       DateTime        @default(now())\n  updatedAt       DateTime        @updatedAt\n}\n\nenum CarType {\n  SEDAN\n  SUV\n  COUPE\n  CONVERTIBLE\n  SPORTS_CAR\n  SUPERCAR\n  HYPERCAR\n  WAGON\n  LIMOUSINE\n}\n\nenum Transmission {\n  AUTOMATIC\n  MANUAL\n  SEMI_AUTOMATIC\n  CVT\n}\n\nenum FuelType {\n  PETROL\n  DIESEL\n  ELECTRIC\n  HYBRID\n  PLUG_IN_HYBRID\n  HYDROGEN\n}\n\nenum DriveType {\n  REAR_WHEEL_DRIVE\n  FRONT_WHEEL_DRIVE\n  ALL_WHEEL_DRIVE\n  FOUR_WHEEL_DRIVE\n}\n\nenum ConditionLevel {\n  BRAND_NEW\n  LIKE_NEW\n  EXCELLENT\n  GOOD\n  FAIR\n}\n\nenum DeliveryOption {\n  NONE\n  LOCAL\n  AIRPORT\n  CUSTOM\n}\n\nmodel CarBookings {\n  id        String  @id @default(uuid())\n  name      String\n  email     String\n  phone     String\n  message   String\n  listingId String\n  vendorId  String\n  read      Boolean @default(false)\n}\n",
